import Form from "react-bootstrap/Form";
import "./ToolForm.css";

const ToolForm = () => {
  return (
    <div>
      <div className="form-container">
        <Form.Control
          type="text"
          placeholder="Normal text"
          style={{ width: "45%", textAlign: "center" }}
        />
      </div>
    </div>
  );
};

export default ToolForm;
